import React from "react";
import "./App.css";
import Table from "./Table";

function GetJson() {
  return [
    {
      id: 1,
      name: "dominic",
      age: 3,
    },
    {
      id: 2,
      name: "ed",
      age: 32,
    },
    {
      id: 3,
      name: "kimin",
      age: 36,
    },
  ];
}

class App extends React.Component {
  state = {
    items: [],
  };
  render() {
    const { items } = this.state;
    return (
      <div className="container">
        <Table itemData={items} removeItem={removeItem} />
      </div>
    );
  }
}

function removeItem(index) {
  const { items } = this.state;

  this.setState({
    itmes: items.filter((item, i) => {
      return i !== index;
    }),
  });
}

